        function xp=hermitequads(K)
            [~,H,~,~,~]=PC.Hermite_PC(1,K+1);
            A=((solve(H{K+1})));
            xp=eval(vpa(A));
            xp = sort(xp);
        end
        function P = getP(m,n)
            P = factorial(m+n)/(factorial(m)*factorial(n));
        end
        function k = kstesthuman(x1,x2)
%             fprintf("By KS Test\n----------------\n");
            [h,p, k] =kstest2(x1,x2);
            fprintf("D alpha is %2.5f\n",k);
            fprintf("P value is %2.5f\n",p);
            
            if(h==true)
                
                fprintf("Distributions are different\n (null-Hypothesis Rejected)\n");
            else
                
                fprintf("Distributions are same\n(null-Hypothesis Acepted)\n");
            end
            
        end
        function ret = convertsymtovar(KLterms,p_order)



            file=fopen('hpce35','w');
            [alpha,Psi_s,Psi_p,PsiSqNorm,P] = PC.Hermite_PC(KLterms,p_order);
            disp(length(Psi_s));
            for i=1:length(Psi_s)
                fprintf(file,'%s\n',char(Psi_s{i}));
            end
            fclose(file);

            file=fopen('hpce35','r');
            s=fgets(file);
            func='Psi={@(x)1, ';
            while ischar(s)
                s=(fgets(file));

                if ~ischar(s)
                    break;
                end
                str=strtrim(s);
                [a b] = regexp(str,'xi_?','match');
                k=length(b);
                for i=1:k
                    str = regexprep (str,'xi_(\d*)','x(:,$1)');
                    %str= strcat(str(1:b(1)-1),'x(:,', str(b(1)+3),')',str(b(1)+4:end));
                end
                str= strrep(str,'*','.*');
                str= strrep(str,'^','.^');
                str= strrep(str,' ','');
                str=strcat('@(x)',str);
                %fprintf ('%s,',str);
                func=strcat(func, str ,',');


            end
            func=strcat(func(1:end-1),'};');
            disp(strcat('elseif(KLterms==',num2str(KLterms), ' && p_order==', num2str(p_order),')'));
            disp(func);
            fid=fopen('pcpoly.m','a');
            fwrite(fid,strcat('elseif(KLterms==',num2str(KLterms), ' && p_order==', num2str(p_order),')'));
            fprintf(fid,'\n');
            fwrite(fid,func);
            fprintf(fid,'\n');
            fclose(fid);
            %disp('end');
            fclose(file);
            ret =func; 
            
        end


